BEGIN TRY
	CREATE ASSEMBLY SqlVec3
	AUTHORIZATION [dbo]
	FROM @DLL_SqlVec3
	WITH PERMISSION_SET = SAFE;
	PRINT 'Created assembly SqlVec3';
