	PRINT 'Could not create assembly SqlVec3 !!!';
	PRINT ERROR_MESSAGE();	
END CATCH
GO


PRINT '*** INSTALL UDT ***'
---
CREATE TYPE dbo.vec3 EXTERNAL NAME SqlVec3.[UserDefinedTypes.vec3];
go

CREATE AGGREGATE dbo.sumvec3(@v vec3) RETURNS vec3 EXTERNAL NAME SqlVec3.[SqlVec3.SumVec3]

CREATE AGGREGATE dbo.h63s000(@v vec3) RETURNS vec3 EXTERNAL NAME SqlVec3.[SqlVec3.h63s000]
CREATE AGGREGATE dbo.h63s121(@v vec3) RETURNS vec3 EXTERNAL NAME SqlVec3.[SqlVec3.h63s121]
CREATE AGGREGATE dbo.h63s131(@v vec3) RETURNS vec3 EXTERNAL NAME SqlVec3.[SqlVec3.h63s131]

CREATE AGGREGATE dbo.h63s121b(@v vec3) RETURNS vec3 EXTERNAL NAME SqlVec3.[SqlVec3.h63s121b]
CREATE AGGREGATE dbo.h63s131b(@v vec3) RETURNS vec3 EXTERNAL NAME SqlVec3.[SqlVec3.h63s131b]

go


CREATE TYPE dbo.histogram EXTERNAL NAME SqlVec3.[UserDefinedTypes.histogram];
go

CREATE AGGREGATE dbo.hist10(@v int) RETURNS histogram EXTERNAL NAME SqlVec3.[UserDefinedTypes.histogram10aggregate]
CREATE AGGREGATE dbo.hist100(@v int) RETURNS histogram EXTERNAL NAME SqlVec3.[UserDefinedTypes.histogram100aggregate]
CREATE AGGREGATE dbo.hist1000(@v int) RETURNS histogram EXTERNAL NAME SqlVec3.[UserDefinedTypes.histogram1000aggregate]
go


CREATE AGGREGATE dbo.group_concat(@v nvarchar(1024), @maxlen int) RETURNS nvarchar(max) EXTERNAL NAME SqlVec3.[UserDefinedTypes.Group_Concat]
go
--====================================================================
CREATE FUNCTION dbo.fHist2Table(@hist dbo.histogram, @includeBounds bit)
-------------------------------------------------------
--/H Transforms a histogram into a table.
--/U --------------------------------------------------
--/T Parameter(s):
--/T <li> @hist the histogram to be transformed
-------------------------------------------------------
RETURNS TABLE 
(
	ix integer, value integer
)
AS EXTERNAL NAME SqlVec3.UDFs.Hist2Table
GO

--=================================
-- Example list of shapes produced form aggregate function, to replace TableValuedVariable in CLR UDFs

CREATE TYPE dbo.shapelist EXTERNAL NAME SqlVec3.[UserDefinedTypes.shapelist];
go

CREATE AGGREGATE dbo.shapes(@ix bigint, @shape nvarchar(1024)) RETURNS shapelist EXTERNAL NAME SqlVec3.[UserDefinedTypes.shapelistaggregate]
go



--====================================================================
CREATE FUNCTION dbo.fShapes2Table(@shapes dbo.shapelist)
-------------------------------------------------------
--/H Transforms a histogram into a table.
--/U --------------------------------------------------
--/T Parameter(s):
--/T <li> @hist the histogram to be transformed
-------------------------------------------------------
RETURNS TABLE 
(
	ix bigint, value nvarchar(1024)
)
AS EXTERNAL NAME SqlVec3.UDFs.Shapes2Table
GO

